import React, { useEffect, useRef } from 'react';
import Svg, { Line, Defs, Pattern, Rect } from 'react-native-svg';
import { View, StyleSheet, Animated } from 'react-native';

const GridBackground = () => {
  const fadeAnim = useRef(new Animated.Value(0.4)).current;
  const translateAnim = useRef(new Animated.Value(0)).current;
  const fadeAnim2 = useRef(new Animated.Value(0.3)).current;

  useEffect(() => {
    // Primary breathing animation
    const breathingAnimation = Animated.sequence([
      Animated.timing(fadeAnim, {
        toValue: 0.8,
        duration: 2000,
        useNativeDriver: true,
      }),
      Animated.timing(fadeAnim, {
        toValue: 0.4,
        duration: 2000,
        useNativeDriver: true,
      })
    ]);

    // Secondary breathing animation (slightly offset)
    const breathingAnimation2 = Animated.sequence([
      Animated.timing(fadeAnim2, {
        toValue: 0.6,
        duration: 3000,
        useNativeDriver: true,
      }),
      Animated.timing(fadeAnim2, {
        toValue: 0.3,
        duration: 3000,
        useNativeDriver: true,
      })
    ]);

    // Movement animation
    const movementAnimation = Animated.sequence([
      Animated.timing(translateAnim, {
        toValue: 50,
        duration: 3000,
        useNativeDriver: true,
      }),
      Animated.timing(translateAnim, {
        toValue: 0,
        duration: 0,
        useNativeDriver: true,
      })
    ]);

    // Start all animations in loop
    Animated.loop(breathingAnimation).start();
    Animated.loop(breathingAnimation2).start();
    Animated.loop(movementAnimation).start();
  }, []);

  return (
    <View style={styles.container}>
      {/* Base layer - larger grid */}
      <Animated.View 
        style={[
          styles.overlay, 
          { 
            opacity: fadeAnim2,
            transform: [{ translateX: Animated.multiply(translateAnim, -0.5) }]
          }
        ]}
      >
        <Svg height="100%" width="100%" style={styles.grid}>
          <Defs>
            <Pattern 
              id="grid3" 
              width="150" 
              height="150" 
              patternUnits="userSpaceOnUse"
              patternTransform="rotate(30)"
            >
              <Line
                x1="0"
                y1="150"
                x2="150"
                y2="150"
                stroke="#600000"
                strokeWidth="1"
              />
              <Line
                x1="150"
                y1="0"
                x2="150"
                y2="150"
                stroke="#600000"
                strokeWidth="1"
              />
            </Pattern>
          </Defs>
          <Rect width="140%" height="140%" fill="url(#grid3)" x="-20%" y="-20%" />
        </Svg>
      </Animated.View>

      {/* Middle layer */}
      <Animated.View 
        style={[
          styles.overlay, 
          { 
            opacity: fadeAnim,
            transform: [{ translateX: translateAnim }]
          }
        ]}
      >
        <Svg height="100%" width="100%" style={styles.grid}>
          <Defs>
            <Pattern 
              id="grid" 
              width="50" 
              height="50" 
              patternUnits="userSpaceOnUse"
              patternTransform="rotate(45)"
            >
              <Line
                x1="0"
                y1="50"
                x2="50"
                y2="50"
                stroke="#800000"
                strokeWidth="0.5"
              />
              <Line
                x1="50"
                y1="0"
                x2="50"
                y2="50"
                stroke="#800000"
                strokeWidth="0.5"
              />
            </Pattern>
          </Defs>
          <Rect width="120%" height="120%" fill="url(#grid)" x="-10%" y="-10%" />
        </Svg>
      </Animated.View>

      {/* Top layer - finest grid */}
      <Animated.View 
        style={[
          styles.overlay, 
          { 
            opacity: fadeAnim2,
            transform: [{ translateX: Animated.multiply(translateAnim, -1) }]
          }
        ]}
      >
        <Svg height="100%" width="100%" style={styles.grid}>
          <Defs>
            <Pattern 
              id="grid2" 
              width="25" 
              height="25" 
              patternUnits="userSpaceOnUse"
              patternTransform="rotate(-45)"
            >
              <Line
                x1="0"
                y1="25"
                x2="25"
                y2="25"
                stroke="#400000"
                strokeWidth="0.3"
              />
              <Line
                x1="25"
                y1="0"
                x2="25"
                y2="25"
                stroke="#400000"
                strokeWidth="0.3"
              />
            </Pattern>
          </Defs>
          <Rect width="140%" height="140%" fill="url(#grid2)" x="-20%" y="-20%" />
        </Svg>
      </Animated.View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    zIndex: -1,
    overflow: 'hidden',
  },
  overlay: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
  },
  grid: {
    position: 'absolute',
    top: 0,
    left: 0,
  },
});

export default GridBackground;
